import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import LoadingContents from "../Home/Loading";
import HOST from "../Setup";

function ProfessorDetails(props) {
  const [professorDetails, setProfessorDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const { id } = useParams();

  useEffect(() => {
    let url = HOST + "/professors/" + id;

    console.log(url);

    fetch(url)
      .then((response) => {
        response.json().then((result) => {
          setProfessorDetails(result);
          console.log(professorDetails);
        });
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  return (
    <div>
      {loading == true ? (
        <LoadingContents />
      ) : (
        <h3>
          {" "}
          {professorDetails.lastname} {professorDetails.firstmane},{" "}
          {professorDetails.academicTitle}{" "}
        </h3>
      )}
    </div>
  );
}

export default ProfessorDetails;
